Excited to tell you about the @earthshotprize, the most ambitious environmental prize in history, and proud to join Prince William as a Prize Council member. The #EarthshotPrize was designed to inspire creative solutions to repairing our planet’s damage over these critical next 10 years, and to bring about real change-and I can’t wait to see it happen. Find out more at @earthshotprize & #linkinbio. 
Feliz de anunciarles el proyecto #EartshotPrize, el premio medioambiental más ambicioso de la historia, y junto al Príncipe William unirme como miembro del Consejo que elegirá el ganador. El #EarthshotPrize fue diseñado para buscar ideas creativas que ayuden a reparar, en los próximos 10 años, los daños producidos en el planeta. Este premio también tiene como objetivo impulsar un cambio real y tengo muchas ganas de verlo convertido en una realidad. Para más información: https://earthshotprize.org/﻿ o #linkenbio
